import {Injectable} from '@angular/core';
import {HttpClient, HttpHeaders} from '@angular/common/http';
import {environment} from '../../environments/environment';

@Injectable({
  providedIn: 'root'
})
export class AuthService {

  private URL = `${environment.API_URL}`;

  constructor(private http: HttpClient) {
  }

  login () {

    const formData = new FormData();
    formData.append('ctl00$TopoLogin$usuario', 'UbxTeam1');
    formData.append('ctl00$TopoLogin$senha', 'DtT4#pFB');
    formData.append('ctl00$TopoLogin$Enviar', 'Ok');
    formData.append('ctl00$TopoLogin$txtUsuario', '');
    formData.append('ctl00$TopoLogin$txtEmail', '');
    formData.append('ctl00$TopoLogin$txtCPF', '');
    formData.append('__VIEWSTATE', '');

    let options = {
      withCredentials: true,
      headers: new HttpHeaders()
        // .set('Content-Type', 'application/x-www-form-urlencoded')
        .set('Accept', 'text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,image/apng,*/*;q=0.8')
        .set('Referer', 'http://hml.policard.com.br/SGP/Login.aspx')
    };

    this.http.post(`${this.URL}/Login.aspx`, formData, options).subscribe(
      (data) => {
        console.log('data', data);
      },
      err => {
        console.error('err', err);
      }
    );
  }
}
